can't open Realm using mongodb sync<p>I can't open a Realm. There is something wrong with my set up. This is the code in the app:</p>
<pre><code>var configuration = user.configuration(partitionValue: &quot;user=\(user.id)&quot;)
configuration.objectTypes = [User.self]
Realm.asyncOpen(configuration: configuration) { [weak self](userRealm, error) in
                self!.setLoading(false);
                guard error == nil else {
                    fatalError(&quot;Failed to open realm: \(error!)&quot;).   ///// here was my error before the edit (I changed the Permission Settings in Sync)
                }
</code></pre>
<p>Error code: &quot;Fatal error: Failed to open realm: Error Domain=io.realm.unknown Code=89 &quot;Operation canceled&quot; UserInfo={Category=realm.basic_system, NSLocalizedDescription=Operation canceled, Error Code=89&quot;</p>
<p>Screenshot of Mongodb Sync configuration</p>
<p><a href="https://i.stack.imgur.com/qAKWt.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/qAKWt.png" alt="Screenshot of Mongodb Sync configuration" /></a></p>
<p>EDIT:
Replaced the Permission settings in Sync with the ones mentioned in the Task Tracker app and that got it connected:</p>
<p><a href="https://i.stack.imgur.com/zKRQi.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/zKRQi.png" alt="enter image description here" /></a></p>
<p>EDIT: the configuration settings were changed to the below as per the suggestions from Jay.</p>
<pre><code>var configuration = user.configuration(partitionValue: &quot;\(currentUser.id!)&quot;)
</code></pre>
<p>Here is my Scheme definition for the User Collection:</p>
<pre><code>{
&quot;properties&quot;: {
&quot;_id&quot;: {
  &quot;bsonType&quot;: &quot;string&quot;
},
&quot;_partition&quot;: {
  &quot;bsonType&quot;: &quot;string&quot;
},
&quot;name&quot;: {
  &quot;bsonType&quot;: &quot;string&quot;
}
},
&quot;required&quot;: [
   &quot;_id&quot;,
   &quot;_partition&quot;,
   &quot;name&quot;
],
&quot;title&quot;: &quot;User&quot;
}
</code></pre>
<p>This is my User class in Xcode:</p>
<pre><code>class User: Object {
@objc dynamic var _id: String = &quot;&quot;
@objc dynamic var _partition: String = &quot;&quot;
@objc dynamic var name: String = &quot;&quot;
override static func primaryKey() -&gt; String? {
    return &quot;_id&quot;
}
}
</code></pre>
<p>EDIT: I got this going to establish a connection by updating the Sync Permissions, so the app does not crash any more. However, now I am getting this message:</p>
<pre><code>Connection to daemon was invalidated
Signup successful!
Log in as user: y
Login succeeded!
2020-10-25...Sync: Connection[1]: Session[1]: client_reset_config = false, Realm exists = false, async open = false, client reset = falseSync: Connection[1]: Session[1]: client_reset_config = false, Realm exists = false, async open = false, client reset = false
2020-10-25...Sync: Connection[1]: Connected to endpoint '13.54.209.90:443' (from '.....:52139')
2020-10-25...Sync: Connection[1]: Reading failed: End of input
2020-10-25...Sync: Connection[1]: Connection closed due to error```
</code></pre>
<p>I don't understand that the error &quot;(&quot;Failed to open realm: (error!)&quot;)&quot; in my above code is not triggered, but then in the log it says that the realm does not exist! So, what's going on here?</p>
<p>EDIT : this is the user table in mongodb, so I created some Users successfully.</p>
<p><a href="https://i.stack.imgur.com/sOM0o.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/sOM0o.png" alt="enter image description here" /></a></p>
<p>EDIT : This is the log from mongodb</p>
<p><a href="https://i.stack.imgur.com/wvv6x.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/wvv6x.png" alt="enter image description here" /></a></p>
<p>As we can see the User Id and the Request ID are not the same! I guess that the two IDs should be the same string in order to be authenticated, right??</p>
<p>I am following the Task Tracker app tutorial from the mongodb webpage for Swift to add the user login to my app. What am I missing here?</p>

