Nodejs Mongodb - Document Property is 'Undefined ' when printing<p>I'm learning Node, Express &amp; Mongodb, hence a very much beginner. I'm developing a form where in there is a text field in which user will add data.</p>
<p>First, i need to check if that data exist or not in a master table. If exist, then i will return the record id else i will create a new record and return its id. Below is the code which I had tried but it's giving me id as undefined.</p>
<p>code.js (controller)</p>
<pre><code>const toolsModel = require('../models/modTools');
const { validationResult } = require('express-validator');
module.exports = {
        async saveCode(req, res)
        {
            var promiseToolId = () =&gt; {
            return new Promise((resolve, reject) =&gt; {
            let tool_exist = toolsModel.findOne({ title: req.body.inpTool });

            if (tool_exist) {
                console.log('tool_exist'); // prints this line
                console.log(tool_exist._id); // gives undefined
                console.log(tool_exist); // prints the object.
                resolve(tool_exist._id);
            }
            else{
                console.log('tool not exist. inserting');
                var newTool = new toolsModel();
                newTool.insert({title: req.body.inpTool, created_at: new Date()}, function(err, newRec)              {
                if(err){
                    console.log('err while inserting');
                    console.log(err);
                    reject(err);
                }
                else{
                    console.log('inserted');
                    console.log(newRec);
                    resolve(newRec._id);
                }
                });
            }
            });
        };

        let errors = validationResult(req);
        if (!errors.isEmpty()){
            console.log('validation error');
            console.log(errors);
        }
        else{
            console.log('form is valid'); // prints this line

            // check if the tool exists in our database
            var toolId = await (promiseToolId()); //anything here is executed after result is resolved 
            console.log('toolId ', toolId); // prints undefined
        }
        }
};
</code></pre>
<p>modTools.js (model)</p>
<pre><code>const mongoose = require('mongoose'),
    timeZone = require('mongoose-timezone'),
    Schema = mongoose.Schema;

const toolsSchema = new Schema({
    title: {type:String, required:true, trim: true},
    created_at: {type: Date, default: Date.now},
});

toolsSchema.plugin(timeZone);

module.exports = mongoose.model('developmentTools', toolsSchema);
</code></pre>
<p>Please note that I'm using Auto-increment id for my model above which i had created using below codes.</p>
<pre><code>db.createCollection(&quot;developmentTools&quot;);

db.developmentTools.insert ( {_id: &quot;toolsId&quot; , toolSeqValue : 0 } );


function getToolsNextID(seqName) {
  var seqDoc = db.developmentTools.findAndModify({
