}
</code></pre>
<p>I know the way I'm accessing the object property <strong>tool_exist.title</strong> is correct but dont know why its giving me undefined.</p>
<p>M I wrong in implemenation of the Promise?</p>
<p>Please help.</p>
<p>Much Regards,</p>
<p>Javed Ansari</p>

