<p>In the app, I have an option for creating a folder. I have everything working correctly. The user clicks &quot;New folder&quot;, then modal pops up where he writes the folder name and clicks &quot;Create folder&quot;. The folder gets created and if it's successful I refresh users page by redirecting it to referer.</p>
