<p>I want to do that without refreshing the page though. So I wrote this piece of code:</p>
<pre><code>// When submitting new folder form trigger an AJAX function
  $(&quot;#newFolderModalForm&quot;).submit(function (event) {
    event.preventDefault();
    ajaxPostNewFolder();
  });

function ajaxPostNewFolder() {
    $.ajax({
      type: &quot;POST&quot;,
      url: window.location + &quot;/new-folder&quot;,
      data: $(&quot;#newFolderModalForm&quot;).serialize(),
      success: function (data) {
        var html = &quot;test&quot;;
        $(&quot;#newFolderModal&quot;).modal(&quot;hide&quot;);
        $(&quot;#materialsTableBody&quot;).prepend(html);
      },
      error: function (e) {
        alert(&quot;Error!&quot;);
        console.log(&quot;Error: &quot;, e);
      },
    });
  }
</code></pre>
<p>With this code, a user clicks the &quot;Create folder&quot; button, ajaxPostNewFolder function gets called and because everything is successful an HTML text &quot;test&quot; gets prepended to a table body.</p>
<p>I want to prepend an entire <code>&lt;tr&gt;</code>element though, consisting of an SVG icon, buttons and name of the folder created.</p>
<p>In a different part of my application I did it like this:</p>
<pre><code>var html =
      '&lt;li&gt;' +
      data.abbreviation +
      ', ' +
      data.name +
      '&lt;/li&gt;';
</code></pre>
